    /**
     * Getter method for accessing route types list
     *
     * @return array
     */
    public function getRouteTypes()
    {
        return self::$routeTypes;
    }

    /**
     * Getter method for accessing directionals associative array
     *
     * @return array
     */
    public function getDirections()
    {
        return self::$directions;
    }

    /**
     * Getter method for accessing states associative array
     *
     * @return array
     */
    public function getStates()
    {
        return self::$states;
    }

    /**
     * Getter method for accessing two-letter state abbreviations
     *
     * @return array
     */
    public function getStateCodes()
    {
        return array_keys(self::$states);
    }

    /**
     * Getter method for accessing full state names
     *
     * @return array
     */
    public function getStateNames()
    {
        return array_values(self::$states);
    }

    /**
     * Getter method for accessing prefix list
     *
     * @return array
     */
    public function getPrefixes()
    {
        return self::$prefixes;
    }

    /**
     * Getter method for accessing cities list
     *
     * @param  string $state
     * @return array|null
     */
    public function getCities($state = null)
    {
        if ($state === null) {
            return self::$cities;
        } else if (strlen($state) === 2 && array_key_exists($state, self::$cities)) {
            return self::$cities[$state];
        } else if (array_key_exists(array_search($state, self::$states), self::$cities)) {
            return array_search($state, self::$states, self::$cities);
        }
        return null;
    }
}